                "description": "(Drama, Inspiration)\nA man (Mike Norris) and a woman help a teenager (Ali Faulkner) after she runs away from her adoptive mother (Janine Turner).\n\nMaggie (Ali Faulker) is an 18 year-old girl who leaves her adopted Christian home after her father's tragic death. Trying to fill a void in her life, Maggie feels the need to locate her birth mother. What she finds is not what she hoped for. Maggie finds a mother that does not love her or want her. Maggie gets caught up in this woman's world. After a few months enough becomes enough and when all hope is lost, one desperate night she reaches her breaking point. In a rage, she releases her frustrations by destroying the seedy hotel room that has been her home. At her feet falls a Bible, and it is then she realizes that there is only one thing that can break the bondage she is in and that is Jesus Christ our Savior. She realizes through God's Word that he has a better plan for her life. Finding the courage she runs away from the nightmare she has been living. With the faith of a mustard seed, Maggie has no place to go but living on the streets alone, broke and scared. Maggie meets just the right people, Max and Grace, who will make her passage a reality. Grace (Sheran Keyton Goodspeed) gives her shelter and wisdom, while Max (Mike Norris), broken himself, becomes a father figure. These two take Maggie under their wings and help her get to where she belongs, at home with her adopted mother (Janine Turner) who has been praying for her safe return.\n\nDirector: Mike Norris\nWriters: Chris Bessey, Raymond Normandin, Mike Norris\nStars: Grant Barker, Ron Bath, Barry Brown, Janine Turner, Ali Faulker, Sheran Keyton",
