                "description": "The true story of Raul Ries. Raul abused his wife and hated his father. His name stood for fear, for fighting, and for fury. To his high school friends, he was a violent, dangerous combatant. In Vietnam, he was a top-notch fighting Marine, yet a danger to his own commanding officer. To others he was a kung-fu expert, but to his family he was a time-bomb ready to explode at any moment. Then one night, a miracle led Raul from black rage into inner peace. Raul Ries was never the same. What could change the heart of a man from a desire to kill his own father & family, to a passion to save him?\n\nDirector: Erik Jacobson\nWriter: Erik Jacobson\nStars: Tom Silardi, Joy Vogel, Gil Gerard",
