                "description": "Fathers is the story of two single fathers and their sons. One of the men, Rick Tarinno, lost his wife in a tragic car accident 3 years ago. Ever since the accident, Rick has blamed God for everything, from the death of his wife to the living hell that his life has turned into. He turned to a life of abuse and drinking to try to drown his sorrows. The other man, Michael Campbell, is approaching the three-year anniversary of the abandonment of his wife and subsequent divorce. The night she left was the same night as Rick's accident. Mike is a blue-collar guy that really had to learn to be a parent after the divorce. He turned to his church family and friends for support and help and they led him to God, his ultimate helper. Rick's son, Lucas, and Michael's son, Raymond, have known each other most of their lives. Since the death of Lucas' mom, things haven't really been the same. Lucas has been the victim of his fathers' abuse and has turned to a new group of friends for the attention that he isn't getting at home. Raymond, the star quarterback on the high school football team, has been trying to maintain their friendship, but can do nothing but watch as his lifelong friend slips lower and lower.   Rick's lack of faith, Michael's commitment to God, and Raymond's longing for his old friend will all be put to the test when Lucas is put in the toughest situation of his young life and Raymond is forced to fight for his. Only then will the truth be sought and hopefully found, before it's too late. \"Fathers\" is a touching look into the spiritual journey of four men searching for their place in the world.\n\nWritten and Directed by Chip Rossetti\nStarring Seth Adair, Mark Clem, Clay Evans",
